const t=JSON.parse('{"key":"v-556ca76b","path":"/cainiao/netty.html","title":"一篇文章搞懂什么是Netty","lang":"zh-CN","frontmatter":{"title":"一篇文章搞懂什么是Netty","shortTitle":"浅析Netty","category":["菜鸟日记"],"tag":["Netty"],"description":"是平时的学习记录","head":[["meta",{"name":"keywords","content":"Java,Java SE,Java基础,Java教程,Java程序员进阶之路,Java入门,教程,java数组,数组,复盘Java基础知识,Java随笔,,Java程序员进阶之路, Java集合框架,java集合框架,netty,什么是Netty"}],["meta",{"property":"og:url","content":"https://wlei224.gitee.io/cainiao/netty.html"}],["meta",{"property":"og:site_name","content":"CS_GUIDER"}],["meta",{"property":"og:title","content":"一篇文章搞懂什么是Netty"}],["meta",{"property":"og:description","content":"是平时的学习记录"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["meta",{"property":"og:updated_time","content":"2023-06-22T02:38:06.000Z"}],["meta",{"property":"article:author","content":"WLei224"}],["meta",{"property":"article:tag","content":"Netty"}],["meta",{"property":"article:modified_time","content":"2023-06-22T02:38:06.000Z"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"一篇文章搞懂什么是Netty\\",\\"image\\":[\\"\\"],\\"dateModified\\":\\"2023-06-22T02:38:06.000Z\\",\\"author\\":[{\\"@type\\":\\"Person\\",\\"name\\":\\"WLei224\\",\\"url\\":\\"/aboutguider/\\"}]}"]]},"headers":[],"git":{"createdTime":1687164533000,"updatedTime":1687401486000,"contributors":[{"name":"WLei224","email":"1149630057@qq.com","commits":2}]},"readingTime":{"minutes":3.04,"words":913},"filePathRelative":"cainiao/netty.md","localizedDate":"2023年6月19日","excerpt":"<blockquote>\\n<p>是什么？</p>\\n</blockquote>\\n<p>Netty 是一个开源的、高性能的、异步的、事件驱动的网络应用程序框架，它基于 Java NIO（Non-blocking I/O）技术，提供了简单易用的 API，可用于开发各种网络应用程序，包括客户端和服务器端应用程序，如网络协议服务器、Web 服务、高性能代理服务器、游戏服务器等。</p>\\n<blockquote>\\n<p>优缺点？</p>\\n</blockquote>\\n<p>优点：</p>\\n<ol>\\n<li>高性能和可伸缩性：Netty 基于 Java NIO 技术，使用非阻塞 I/O 模型，具有更好的性能和可伸缩性，可以处理大量的并发连接。</li>\\n<li>异步和事件驱动：Netty 使用事件驱动的设计模式，通过异步的方式处理网络 I/O 事件，提高了应用程序的并发处理能力。</li>\\n<li>简单易用的 API：Netty 提供了简单易用、灵活可扩展的 API，使得开发网络应用程序更加容易和快速。</li>\\n<li>支持多种协议：Netty 支持多种主流的网络协议，如 HTTP、WebSocket、TCP、UDP、SMTP、FTP 等，且支持自定义的协议。</li>\\n<li>可扩展性：Netty 的设计允许用户自定义和扩展各种组件，包括编解码器、处理器、事件监听器等。</li>\\n</ol>"}');export{t as data};
